import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

class SignUpPage extends Component
{

  constructor(props)
  {
    super(props);

    this.state = {

      email: '',
      username: '',
      password: '',
      hasPremium: '0',

      passCheck: new Boolean,
      canProceed: new Boolean

    }
  }

  checkCreds = () => {
    if(this.checkEmail() == true && this.checkUsername() == true && this.checkPassword() == true && this.state.passCheck == true)
    {
      console.log("Can Proceed");
      this.state.canProceed = true;
      this.sendLogin();
    }
    else{
      console.log("Cant Proceed");
    }
  }

  checkEmail = () => {
    var canGo;
    if(this.state.email.includes("@gmail.com") || this.state.email.includes("@yahoo.com") || this.state.email.includes("@hotmail.com") || this.state.email.includes("@outlook.com"))
      {
        console.log("Valid Email");
        
        canGo = true;
      }
      else{
        console.log("Please Provide a Valid Email Address");
        canGo = false;
      }
    return canGo;
  }

  checkUsername = () => {
    var canGo;
    if(this.state.username.length >= 5)
    {
      console.log("Valid Username");
      canGo = true;
    }
    else{
      console.log("Please Provide a Username More than 5 Characters");
      canGo = false;
    }
    return canGo;
  }

  checkPassword = () => {
    var passLength;
    var passNum;
    var specialCheck;
    var overall;

    // Password Length Check
    if(this.state.password.length >=8)
    {
      passLength = true;
      for(var i = 0; i <= 10; i++)
      {
        console.log("Valid Length");
        if(this.state.password.includes(`${[i]}`))
        {
          console.log("Verified Number Check");
          passNum = true;
          break;
        }
        else if(i == 10 && passNum == false)
        {
          console.log("Failed Number Check");
          passNum = false;
          break;
        }
      }

      // Special Character Check
      if(this.state.password.includes("!") || this.state.password.includes("@") || this.state.password.includes("#")
       || this.state.password.includes("$") || this.state.password.includes("%") || this.state.password.includes("^")
        || this.state.password.includes("&") ||this.state.password.includes("*") || this.state.password.includes("?")
         || this.state.password.includes(">") || this.state.password.includes("<") || this.state.password.includes(".")
         || this.state.password.includes("/") || this.state.password.includes("~") || this.state.password.includes("`"))
         {
            console.log("Verified Special Character Check");
            specialCheck = true;
         }
         else
         {
          console.log("Failed Special Character Check");
          specialCheck = false;
         }
    }
    else
    {
      console.log("Pasword Invalid Length");
      this.passLength = false;
    }

    if(passLength && passNum && specialCheck)
    {
      console.log("Password Succeeded Full Check");
      overall = true;
    }
    else
    {
      console.log("Password Failed Full Check");
      overall = false;
    }

    return overall;
  }

  checkPasswords = (e) => {
    e.preventDefault();
    if(e.target.value == this.state.password)
    {
      console.log("Passwords Match");
      this.state.passCheck = true;
    }
    else{
      console.log("Passwords Dont Match");
      this.state.passCheck = false;
    }
  }

  getEmail = (e) => {
    e.preventDefault();
    this.setState({email: e.target.value});
  }

  getUsername = (e) => {
    e.preventDefault();
    this.setState({username: e.target.value});
    if(e.target.value.length >= 5)
    {
      document.getElementById("usernamecheck").className = "text-green-400";
    }
  }

  getPassword = (e) => {
    e.preventDefault();
    this.setState({password: e.target.value});
    //if(this.state.password )
  }

  async sendLogin(){
    let url_post = 'https://localhost:7257/api/sendinfo';
    

    try{
      await axios.post(url_post, {
        email: this.state.email,
        username: this.state.username,
        password: this.state.password,
        hasPremium: this.state.hasPremium
      })
      .then(function(response) {
        console.log(response.data);
      })

    }catch(e)
    {
      console.log(e);
    }
  }

  render(){
    return(
      <>
<div className='flex h-screen'>
<span className="font-semibold text-white text-2xl tracking-wider absolute left-4 sm:left-28 m-4"><Link to="/">VitalUI</Link></span>
<div className=" px-4 py-16 mx-auto sm:px-6 lg:px-8">

<div className="max-w-lg mx-auto text-center mt-36">

  <h1 className="text-2xl font-bold text-white sm:text-3xl">Create Your Account!</h1>

  <p className="mt-4 text-gray-500">
    Become a Member Today and Get Access to a Samll Section of Free Components! We Can't Wait to See What You Create With Our Components!
  </p>
</div>

<form action="" className="max-w-md mx-auto mt-8 mb-0 space-y-4">
  <div>
    <label className="sr-only">Email</label>

    <div className="relative">
      <input
        onChange={this.getEmail}
        className="w-full p-4 pr-12 text-sm border-gray-200 rounded-lg shadow-sm"
        placeholder="Email"
        type="email"
        required={true}
      />

      <span className="absolute inset-y-0 inline-flex items-center right-4">
        <svg
          xmlns="http://www.w3.org/2000/svg"
          className="w-5 h-5 text-gray-400"
          fill="none"
          viewBox="0 0 24 24"
          stroke="currentColor"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth="2"
            d="M16 12a4 4 0 10-8 0 4 4 0 008 0zm0 0v1.5a2.5 2.5 0 005 0V12a9 9 0 10-9 9m4.5-1.206a8.959 8.959 0 01-4.5 1.207"
          />
        </svg>
      </span>
    </div>
    <div className=' text-gray-300'>
      Valid Email Address
    </div>
  </div>

  <label className="sr-only">UserName</label>

    <div className="relative">
      <input
        onChange={this.getUsername}
        className="w-full p-4 pr-12 text-sm border-gray-200 rounded-lg shadow-sm"
        placeholder="Username"
        type="username"
